import React from "react";

import "./style.css"

const ButtonCart = ( props ) =>{
    const { increaseHandle, decreaseHandle, count} = props 
    return (
    <div className="common-button-box">
        <button className="box-left" onClick={increaseHandle}>-</button>
        <span>{count}</span>
        <button className="box-right" onClick={decreaseHandle}>+</button>
    </div>)
}

export default ButtonCart
